import { createMuiTheme } from '@mui/material/styles';
import themeOptions from "./thememui5";

const theme = createMuiTheme({
  ...themeOptions,
  palette: {
    ...themeOptions.palette
  },
  typography: {
    ...themeOptions.typography
  },
  components: {
    ...themeOptions.components
  }
});

export default theme;
